INSERT INTO `University` VALUES (1,'A20','The University of Aberdeen','http://www.abdn.ac.uk/international/brazil.php','The University of Aberdeen is the fifth oldest University in the UK, with a large international community of students. Founded in 1495, it has never deviated from its core ideals on teaching, learning and discovery. Ambitious and research-driven, the University offers an encouraging, stimulating and supportive environment to students. Aberdeen, the Oil and Gas Capital of Europe, is a thriving international city and the University of Aberdeen is a recognised world leader in many areas of the oil and gas/energy industry. These include Geology and Petroleum Geology, Chemical Engineering, Petroleum Engineering, Environmental Science, and Marine Biology.'),(2,'A40','Aberystwyth University','http://www.aber.ac.uk/en/international/science-without-borders/','Founded in 1872, as the first University Institution in Wales (UK), Aberystwyth has a long reputation of academic excellence. Today, it has around 10,000 students from more than 90 countries, including 1,500 postgraduates, across seventeen academic departments. Set in beautiful scenery on the shores of Cardigan Bay, Aberystwyth is continually voted as one of the best universities in the UK for student satisfaction. Aberystwyth is particularly strong in Biological and Rural Sciences; Agriculture; Geography & Earth Sciences; Computer Science; Physics and Mathematical Sciences; International Politics and Theatre, Film and Television Studies. Aberystwyth is one of the safest and most affordable locations in the United Kingdom and we offer a warm welcome to students from Brazil.'),(3,'A60','Anglia Ruskin University','http://www.anglia.ac.uk/ruskin/en/home/study/international.html','Anglia Ruskin University has a history of over 150 years starting as Cambridge School of Art in 1858. Today, with a population of 31,000 students from UK/EU and around 1,500 international students, we are one of the largest universities in the East of England. Our students are on courses leading to Undergraduate and Postgraduate degrees, as well as to a range of professional qualifications. Our University has two modern campuses in two exciting cities - Cambridge and Chelmsford - each less than one hour away from London by train.  Anglia Ruskin\'s campuses are right in the centre of both cities, with state-of-the-art learning and recreational facilities available for all students.'),(4,'A80','Aston University - Birmingham','http://www1.aston.ac.uk/international-students/','Founded in 1895 and a University since 1966, Aston is a long established research-led University known for its world-class teaching quality and strong links to industry, government and commerce. Aston has a strong reputation for developing highly-skilled, sought-after, employable graduates from a diverse range of backgrounds and currently the University is ranked 8th overall for graduate employment (2013 Sunday Times University Guide). Aston has over 10,200 students including 8,500 undergraduates and 24% of students come from 120 countries outside the UK. The Aston University campus is located in the heart of Birmingham, the UKï¿½s second city, with a population of 1.3 million.  The Universityï¿½s location makes it ideal for access to the national road and rail network, and being only 90 minutes from London, makes it within easy reach of most of the UK and beyond.  Additionally, all University facilities are based on our city-centre safe and friendly campus which provides the perfect environment for academic success and a fantastic social life.'),(5,'B06','Bangor University','http://www.bangor.ac.uk/international/','Founded in 1884, Bangor University is one of the oldest and most prestigious universities in the UK. Located in beautiful North Wales, close to the mountains and sea Bangor University offers students a wide variety of study programmes, modern facilities and a unique experience.  Our teaching standards are high with most departments rated \'excellent\' for teaching quality. Coupled with the high calibre of research activity, students at Bangor enjoy teaching of a high standard delivered by true experts in their field. Areas of particular excellence include Electronic Engineering, ranked No.2 in the UK (RAE 2008) and Environmental & Ocean Sciences.'),(6,'B16','University of Bath','http://www.bath.ac.uk/study/international/','Currently nominated the \'Sunday Times University of the Year\', the University of Bath is a highly respected university in the South West of England. We are well known for our focus on professional courses and have a strong focus in Science and Engineering. Our students are in demand by employers because of the high quality of teaching and our emphasis on preparing students for successful careers. The University is set in an attractive campus two kilometers from the beautiful city of Bath, a UNESCO World Heritage City. We offer a safe and friendly campus with good facilities and social opportunities.'),(7,'B22','University of Bedfordshire','http://www.beds.ac.uk/international','For more information on the University of Bedfordshire please visit their website.'),(8,'B25','Birmingham City University','http://www.bcu.ac.uk/international','With nearly 6,000 of our 25,000 students enrolled on courses in Music, Theatre, Writing, Media, Digital Technology, or Art and Design,Birmingham City Universityis one of Britain\'s leading providers of graduate talent to the cultural and creative industries. Our internationally-renowned arts training provision includes specialist conservatoires of music and acting; a leading media school; a school of English producing world-class research; and the UK\'s largest regional centre for art, architecture and design education, including Europe\'s largest jewellery school. With outstanding tutors and facilities, we offer an exceptionally friendly and supportive atmosphere in which to develop your individual artistic and creative talents.'),(9,'B32','The University of Birmingham','http://www.birmingham.ac.uk/index.aspx','The University of Birmingham boasts a thriving and diverse community with 28,000 students enjoying the excellent facilities on our beautiful green leafy campus in the UK\'s second city. Over 4200 of our students are international, coming from 150 different countries including Brazil. We offer an elite academic experience and our range of research is one of the widest in the UK. From cancer research to developing new types of fuel, our academics are at the forefront of new theory and technology, which means we can provide a wide range of opportunities for Science without Borders students.'),(10,'B50','Bournemouth University','http://www.bournemouth.ac.uk/futurestudents/international/','Bournemouth University\'s academic, business and student services are geared to the professions and supported by a passionate commitment to high-quality academic endeavour and achievement. We enjoy a reputation for excellence through education, research, enterprise and professional practice. And whilst we remain committed to our region, we have an outlook that is truly global. We value creativity, innovation, partnership and enterprise with an attitude that is friendly, professional, inclusive and supportive. We are large enough to offer our students diversity, yet small enough for them to be part of a friendly and thriving cosmopolitan community. Our programmes are designed and delivered to give our graduates every opportunity to pursue employment and career enhancement and we consistently achieve high rates of graduate-level employment.'),(11,'B56','University of Bradford','http://www.bradford.ac.uk/international/','With 15% of our students joining us from over 110 different countries, we are used to giving newcomers to Bradford a very warm welcome.'),(12,'B72','University of Brighton','http://www.brighton.ac.uk/international/','University of Brighton is a modern, innovative university on the south-east coast of England, focused on enhancing your academic learning with experience in industry and state-of-the-art facilities and technology. Our campuses are in beautiful locations, ideally placed for you to experience British culture and academic life. Brighton is less than an hour away from London. The latest Research Assessment Exercise rated 79% of our research output of international standing. Our researchspans a range of disciplines including biomedical sciences, engineering, nuclear physics, geosciences, environmental sustainability and society and environment. All students benefit from being part of an applied research-active community.'),(13,'B78','University of Bristol','http://www.bristol.ac.uk/international/','The University of Bristol is a globally renowned research university that ranks among the top 30 universities worldwide*. With 18,000 undergraduate and postgraduate students from 120 countries in its six faculties, Bristol is recognised for its research excellence and is a member of the Worldwide Universities Network. Bristol is a multicultural city located in the south-west of England, only 90 minutes from London, and has its own international airport. The University is located in the heart of the city, surrounded by magnificent architecture and beautiful parkland, making it a wonderful place to study and live. (*2011 QS World University Rankings).'),(14,'B80','University of the West of England - Bristol','http://www1.uwe.ac.uk/comingtouwe/internationalstudents.aspx','The University of the West of England, Bristol is a modern University with a strong reputation for teaching quality having been ranked 5th in a recent QAA. Based in Bristol, just 90 minutes from London, UWE is one of the UK\'s most popular Universities in the UK with over 30,000 students. UWE works on world leading projects such as the Bloodhound project and was ranked 3rd in the world for our International Career Development Centre*. We currently work closely with University partners in Brazil and look forward to welcoming Brazilian students to our campus. *International Student Barometer.'),(15,'B84','Brunel University','http://www.brunel.ac.uk/international','Brunel University offers the chance to study in an attractive campus location with excellent facilities including accommodation, while still only being a short distance from the centre of London. Our commitment to ensuring all students are supported means we are able to offer incoming students a free orientation programme, day trips to famous UK tourist destinations and regular on campus events. For those students interested in taking a Pre-sessional English course before starting their Programme of Study, our International Pathways and Language Centre (IPLC) was recenty rated as one of the best Universty language centres in the UK. Students at IPLC benefit from small class sizes, friendly and well informed teachers and an engaging social programme.'),(16,'C15','Cardiff University','http://www.cardiff.ac.uk/for/prospective/inter/','Founded in 1883 by Royal Charter, Cardiff University today is one of the UK\'s largest, most respected and most popular universities. Cardiff is a member of the UK\'s \'Ivy League\' of Russell Group research intensive universities. Our students study in an environment enriched by links with the professions and with world-class facilities. The University\'s expertise in research-led teaching encompasses: the humanities; the natural, physical, health, life and social sciences and engineering. Engineers are also among the many Science Technology Engineering and Mathematics researchers working with biomedical colleagues to deliver practical healthcare change, for example, through the multi-million pound Arthritis Research UK-funded Biomechanics and Bioengineering Centre.'),(17,'C20','Cardiff Metropolitan University - UWIC','http://www.cardiffmet.ac.uk/brazil','Cardiff Metropolitan University (UWIC) is ranked as the top modern University in Wales, and amongst the top modern Universities throughout the UK. With over 11,000 students from over 140 countries, the University has a unique multi-cultural mix, and is located in one of Europe\'s youngest, friendliest, vibrant and most exciting capital cities. Ranked top in the UK for International Student Satisfaction for the third year running, Cardiff Met have developed courses in conjunction with business and industry and aim to prepare students for future study and employment in a wide range of diverse areas. Cardiff School of Art & Design is a leading European art school, placed eleventh in terms of research power in the UK in the RAE 2008. Courses include Architectural Design & Technology, Product Design and Graphic Communication. Cardiff School of Management is amongst the largest in Europe, specializing in Business Information Systems, Multimedia, Networking, Systems Development, Computing, Management and Tourism & Hospitality. Cardiff Met also offers a wide variety of degrees in Healthcare Sciences, Education and Sport. Cardiff Met is committed to helping international students get the most out of their time studying in the UK, in addition to ensuring that upon graduating, students are in demand by employers.'),(18,'C55','University of Chester','http://www.chester.ac.uk/node/13244','The University of Chester is one of the oldest educational institutions in the country, with 16,000 students from over 50 countries. We are located in the historic city of Chester, which is within an hour of Manchester and Liverpool. A number of our subjects have been ranked in the top 10 by major national newspaper league tables (for instance, Mathematics is 9th in the country for student satisfaction). We will provide you with a fantastic experience both on and off campus. There are social and volunteering events organised throughout the year, and Chester Student Union runs over 70 clubs and societies.'),(19,'C85','Coventry University','http://www.coventry.ac.uk/international','Quality teaching, employable graduates, strong links with industry and an innovative approach to learning - just a few highlights of studying with Coventry University. Over 20,000 students, including 5,000 international students, study on our diverse and vibrant campuses in Coventry and London. Opportunities to benefit from work experience are embedded into the curriculum through a large number of work placements and internships. Our curriculum is reinforced with modules specifically tailored to provide students with essential employability skills. Coventry University is the first step towards your future career.'),(20,'D26','De Montfort University','http://www.dmu.ac.uk/international/en/international.aspx','De Montfort University (DMU) is located in the multicultural city of Leicester and has more than 20,000 students, including more than 2,000 international students. The University is made up of 4 faculties offering around 400 courses. Our courses are designed with employment in mind and more than 170 courses are accredited by professional bodies such as CIM, CIMA, ACCA and IET. We continually invest in our campus and our facilities, with the latest studios, workshops and laboratories, a new ï¿½35 million Business and Law faculty, an ï¿½8 million Nursing and Midwifery building and a new Leisure Centre opening this summer.'),(21,'D39','University of Derby','http://www.derby.ac.uk/international','The University of Derby is in the heart of the UK just 90 minutes from London by train. We offer our international students over 140 undergraduate courses and more than 60 postgraduate courses including engineering, computing, environmental science, animation, art and design. With students from more than 100 different countries we excel in helping international students progress their careers. We have recently invested ï¿½100 million on state of the art facilities across both of our campuses and have a comprehensive range of support for our international students through our dedicated International Student Centre. They have expert advisors to deal with any issues our international students may face.'),(22,'D65','University of Dundee','http://www.dundee.ac.uk/admissions/international/science_without_borders.htm','The University of Dundee is one of the world\'s top 200 universities - with particular strengths in medicine, life-sciences, engineering, energy, environment, design and digital media.  The University\'s origins date back to 1881 - gaining its Royal Charter in 1967 - and recently described as \'one of the success stories of British higher education\' (Sunday Times, 2011).  With staff from 65 different countries, international students from more than 83 countries and research and teaching connections throughout the world, the University has a strong international focus.  The University of Dundee is top in the UK for all-round student experience (Times Higher, 2012)'),(23,'D86','Durham University','http://www.dur.ac.uk/international/','Durham University (founded 1832) is the third oldest university in England and consistently ranked as one of the best universities in the UK. The Sunday Times University Guide 2012 placed Durham as the 3rd in the UK and it was ranked as 83rd in the world in the 2011/12 THE world rankings. The University seeks to achieve the highest distinction in research and scholarship and has key strengths in Biological and Biomedical Sciences, Chemistry, Computer Science, Earth Sciences, Engineering, Physics and Mathematics. The student experience is underpinned by a unique collegiate system providing amazing opportunities for personal development.'),(24,'E14','University of East Anglia','http://www.uea.ac.uk/sci/science-without-borders','The University of East Anglia is a World Top 150 and UK Top 20 University with an outstanding record in teaching, research and student satisfaction.  We are a campus university with prize-winning social and sports facilities in one of the most attractive and safe regions of the UK.   We have close links with Brazil and understand the needs of the Brazilian education system, hence we have put together a flexible and modular Science Without Borders programme which covers Chemistry, Environmental Science, Computing Science, Mathematics, Biology and Pharmacy. In addition we are prepared to welcome students onto our Creative Industries programmes.'),(25,'E28','University of East London','http://www.uel.ac.uk/international/brazil/index.htm','University of East London is a large, modern institution with a diverse student body of around 28,000. Located in the exciting city of London in the UK, we offer high quality education on our two well-equipped campuses. With dozens of courses available, we have an excellent reputation for teaching and research, particularly in the fields of science, engineering and the creative industries. 2012 has seen the opening of our brand new ï¿½20million sports facility, the SportsDock, the official training site for Team USA during the London 2012 Olympic Games. We are connected to the Olympics in many ways, and have a research partnership with Game Filho University in Rio and University of Sao Paulo NUTAU in Sao Paulo relating to the legacy of such events.'),(26,'E42','Edge Hill University','http://www.edgehill.ac.uk/international/brazil-science-without-borders-programme/','Founded in 1885, Edge Hill University is located on a stunning campus near the historic city of Liverpool. Both Manchester and Liverpool John Lennon airports are in easy reach making Edge Hill University highly accessible. In 2007, 2010 and 2011, the University was shortlisted for the Times Higher Education \'University of the Year\' award. Our links with industry such as the BBC and Granada provide you access to a wide network of professionals. Hands on experience and practical teaching are central to our learning approach.  which includes the Business School; Law and Criminology; and Natural, Geographical and Applied Sciences. Edge Hill \'boasts some of the most satisfied students in the UK\' according to the Times Higher Education Student Experience Survey 2012.'),(27,'E59','Edinburgh Napier University','http://www.napier.ac.uk/study/international/Pages/International.aspx','Edinburgh Napier University is one of the largest higher education institutions in Scotland with nearly 17,000 students including almost 4,000 international students from over 100 countries - a truly International experience. A multi-campus university with 3 main campus located in Scotland\'s beautiful capital city. We\'re Edinburgh\'s innovative and professional University - committed to giving you the right mix of personal and professional skills for a successful career in today\'s global market. Join us and live in Edinburgh, a vibrant, cosmopolitan city with a 24-hour, student-friendly buzz. Benefit from excellent career prospects, a high standard of teaching and outstanding International student support.'),(28,'E70','The University of Essex','http://www.essex.ac.uk/international/why.aspx','For more information on the University of Essex please visit their website.'),(29,'E84','University of Exeter','http://www.exeter.ac.uk/international/','Exeter is a leading international university located in the South West of England. It is a research-focussed institution, offering students outstanding facilities and an exceptional student experience. The University is ranked in the top 1% of universities worldwide and is consistently in the top 10 universities in the UK (Times, Sunday Times, Guardian).  Students themselves have rated Exeter in the top 10 of the National Student Survey for the last seven years (NSS2005-2011).  90% of Exeter\'s research is rated as being at internationally recognised levels (RAE 2008) with 16 subjects ranked in their respective top 10.'),(30,'F33','University College Falmouth','http://www.falmouth.ac.uk/318/international-study-17.html ','University College Falmouth is a vibrant and forward-thinking specialist arts University. We are a key player in the UK and international creative scene. Grounded in a history of artistic pursuit and technological invention, and set against a backdrop of stunning natural beauty, Cornwall is an inspiring place to live and study. Our diverse community of students enjoy a quality of life that is richly stimulating. Our international reputation in Art, Design, Media, Performance and Writing has grown from over a century of nurturing original thinking, supported by highly talented and professional staff. Falmouth\'s Schools of Art & Design and Media & Performance offer innovative, entrepreneurial, collaborative and transformative learning experiences. We have a diverse student and staff population, drawing on talent from around the world. UCF has invested over ï¿½100 million in developing world class facilities that provide outstanding teaching, research and performance space. The on-going internationalisation of our academic provision broadens our cultural vision and creativity.'),(31,'G28','University of Glasgow','http://www.gla.ac.uk/international/','The University of Glasgow is the fourth oldest university in the English-speaking World and, is ranked in the top 1% of the world\'s Universities, ranked first in the UK for overall student satisfaction, offers a wide range of courses in areas such as Engineering (Civil, Electronic & Electrical, Mechanical, Aerospace & Aeronautical) Psychology, Life Sciences, Veterinary Biosciences, Computing Sciences, Chemistry, Physics & Astronomy, Mathematics & Statistics, Geographical & Earth Sciences. The University has a student population of over 23,000 from more than 120 countries and is located in Scotland\'s largest city, which has a renowned, vibrant music scene, excellent shopping and a wealth of arts and cultural venues.'),(32,'G42','Glasgow Caledonian University','http://www.gcu.ac.uk/study/internationalstudents/science-without-borders/','GCU is located in the heart of Glasgow, a Top 10 City of the World.  We provide state of the art facilities together with modern student accommodation, situated across from our city centre campus. We offer a range of programmes across three academic schools, where our research is considered to be of international quality. Our allied health research, for example, is ranked top in Scotland and top 10 in the UK. All of our programmes aim to equip students with industry relevant skills and we have excellent links with companies including IBM, Santander and CISCO. Our degree programmes are also fully accredited by the relevant professional bodies.'),(33,'G56','Goldsmiths - University of London','http://www.gold.ac.uk/international/science-without-borders/','For more information on Goldsmiths - University of London please visit their website.'),(34,'G70','University of Greenwich','http://www2.gre.ac.uk/students/international','For more information on the University of Greenwich please visit their website.'),(35,'H12','Harper Adams University','http://www.harper-adams.ac.uk/international/','Harper Adams University College is the UK\'s leading specialist provider of higher education for the agri-food chain and rural sector. Known for excellence and innovation, it offers state-of-the-art facilities and rewarding courses for undergraduate, postgraduate and lifelong learners in agriculture, agribusiness, animal, engineering, food, rural and land-based studies. It is top three in the UK for graduate employment with over 98% of graduates employed within six months of graduation*. Harper Adams is the UK\'s only provider of Agricultural Engineering degrees and its graduates, with their applied skills and can-do attitude are highly sought after by global engineering companies such as JCB, CLAAS, John Deere and Jaguar Land Rover.'),(36,'H24','Heriot-Watt University - Edinburgh','http://www.hw.ac.uk/student-life/international-students.htm','Founded in 1821, Heriot-Watt University is one of the UK\'s leading universities. The University has campuses in Edinburgh, the Scottish Borders, Orkney, Dubai and Malaysia. Heriot-Watt University aims to provide students global access to a high quality learning experience. It is recognised internationally for excellent teaching and research in its specialist areas of science, engineering, business management, languages and textile design.'),(37,'H36','University of Hertfordshire','http://www.herts.ac.uk/international-students/regions-and-countries/americas/brazil.cfm','The University of Hertfordshire is an ambitious and entrepreneurial university and was recently awarded the prestigious Times Higher Education \'Entrepreneurial University of the Year\' award. It offers excellence in teaching, learning and research, and puts students at the heart of its activities. The University has a strong international outlook, welcoming more than 2,000 overseas students from 85 different countries each year. Join us and you\'ll be a valued member of our truly global campus community. The University has the perfect location, just 25 minutes by train from London in the beautiful Hertfordshire countryside. Its two well-equipped campuses in Hatfield (College Lane and De Havilland) are safe, attractive places to live and study.'),(38,'H72','The University of Hull','http://www2.hull.ac.uk/international.aspx','Established in 1928, the University of Hull has a distinguished history of providing quality education and rich life experience to students from around the globe. Every student arriving at the Universy joins not only a prestigious academic institution but a warm, supporting and friendly community where students come first. Students give our programmes some of the highest satisfaction levels in the country, and official teaching reviews rate our degrees as world-class. The University offers excellent teaching and research in STEM subjects and contributes to current developments in this field.'),(39,'K12','Keele University','http://www.keele.ac.uk/international/thinkingofapplying/countrypages/southamerica/brazilcountrypage/','The Keele University campus spreads over 630-acres of beautiful Staffordshire countryside and is approximately 2 hours North-West of London. The university delivers degree courses through three Faculties: Health; Humanities and Social Science; and Natural Sciences, within which Life sciences and Environmental Studies are areas of excellence. Keele\'s research is highly regarded across the world, with 85% of research work being of international standard and 11% being world class and Keele is consistently ranked in the top 10 for Student Satisfaction.  Students can participate in many sports and societies, volunteer in the community and enjoy a vibrant social scene on campus.'),(40,'K24','The University of Kent','http://www.kent.ac.uk/int/','University of Kent is among the top 15% of UK universities (National Research Assessment Exercise 2008), and ranks as one of the best universities in terms of student satisfaction. With campuses in Canterbury (55 minutes to London by train), Medway, Brussels and Paris, Kent provides an excellent academic and social experience at the heart of Europe. We have a long history of teaching and research collaboration with universities in Brazil, including USP, UNB, Campinas, Rio Grande do Sul and Pernambuco. Kent\'s outstanding departments include Bio-Sciences (Cancer Biology, Molecular Processing), Electronic Engineering and Digital Arts, Computing, Architecture, Materials Physics, Astronomy, Applied Optics, Drama and Film, Conservation and Biodiversity.'),(41,'K84','Kingston University','http://www.kingston.ac.uk','For more information on Kingston University please visit their website.'),(42,'L14','Lancaster University','http://www.lancs.ac.uk/faculties-and-departments/','Our international reputation for academic excellence, combined with our fantastic campus setting and world-class facilities, attracts international students from over 110 countries. Lancaster is a top 10 UK university and is ranked in the top 1% worldwide.  Leading departments include Environmental Science, Maths and Statistics, Physics, Sociology, Psychology, Linguistics, Politics, Health and Medicine and Management and Business.  92% of our research is recognised as of international standard. We offer a safe and friendly campus environment in the North West of England, one hour by train from Manchester. You will find good quality accommodation and a thriving community here.'),(43,'L23','University of Leeds','http://www.leeds.ac.uk/info/30316/americas/218/brazil','The University of Leeds is one of the UK\'s top universities, in the heart of one of the UK\'s most cosmopolitan, exciting and student-friendly cities. Established in 1904, the University is a member of the Russell Group, formed by the country\'s top research institutions. Each year over 5,000 international students from 140 countries choose to study at Leeds, on our dynamic single-site and continually developing campus. Leeds is well-known for range of courses it offers. We offer hundreds of degree courses across nine faculties. Our Business School, Faculty of Engineering and School of Law are especially well regarded.'),(44,'L27','Leeds Metropolitan University','http://www.leedsmet.ac.uk/international/','Leeds Metropolitan University is one of the most popular universities in the UK and a real favourite with international students. We offer world-class teaching in an exciting learning environment and an unforgettable student experience. Our courses are developed in conjunction with first class employers and we employ internationally acknowledged academics who are experts in their field. Our international students have ranked us 1st for our language support, accommodation quality and learning spaces (International Student Barometer 2010). Our research is graded world-leading or internationally excellent in areas including Art and Design and Communication, Cultural and Media Studies (RAE 2008).'),(45,'L34','University of Leicester','http://www2.le.ac.uk/study/international','The University of Leicester, established in 1921, is a public institution situated in the centre of England, just over one hour by train from London. With a leading international reputation for teaching and research, we are ranked in the top 200 universities in the world (QS World Rankings 2011-12) and within the top 20 in the UK (Times 2012). Of our 13,000 full-time students on campus, almost 25% come from outside the European Union, from a total of more than 80 countries. Our strengths extend across all disciplines, from Medicine, Biological Sciences and Engineering, to Arts, Social Sciences and Law.'),(46,'L39','University of Lincoln','http://www.lincoln.ac.uk/home/international/','Lincoln is one of the fastest rising UK universities in the UK rankings - we have jumped 48 places in just 3 years! We have spent ï¿½140 million pounds on our modern compact campus which is in the centre of the ancient City of Lincoln. We have very high student satisfaction rankings and welcome students from over 90 countries. Lincoln is a more economical place to live than many parts of the UK and is 2 hours by train from London. We offer degrees in: Mechanical Engineering, Animal Science, Biology/Biomedical/Forensic/Bioveterinary Science, Computer Science, Sport Science and many more!'),(47,'L41','The University of Liverpool','http://www.liv.ac.uk/study/international/science-without-borders-en.htm','For more information on the University of Liverpool visit their website.'),(48,'L51','Liverpool John Moores University','http://www.ljmu.ac.uk/International/','Ranked in the top 400 universities world-wide in 2011, LJMU offers you an exceptional international student experience, founded on high quality teaching, ground-breaking research and extensive links with employers and business leaders. Our degrees are not only intellectually stimulating but will also equip you with the skills and experience required for professional success. It\'s a big decision to study abroad and we know how difficult it can be to decide where and what you want to study in the United Kingdom. That\'s why we will take great care to make sure you have all the information and support you need to plan for your studies at LJMU. We can give you advice on everything from immigration procedures, travel, accommodation, tuition fees and working in Liverpool. So if you have any questions about any aspect of studying at LJMU, please contact us.'),(49,'L75','London South Bank University','http://www.lsbu.ac.uk/international/','With almost 2,000 international students from over 130 countries, London South Bank University (LSBU) is the ideal choice for studying in one of Europe\'s most exciting cities. Just minutes from London\'s major attractions, LSBU has a history of preparing students for the workplace for the past 120 years.'),(50,'L79','Loughborough University','http://www.lboro.ac.uk/international/','For more information on Loughborough University please visit their website.'),(51,'M20','The University of Manchester','http://www.manchester.ac.uk/international/country/brazil.htm','The University of Manchester is one of the top universities in the world and has an international reputation for its research and teaching across a diverse portfolio of subjects. The University\'s campus is an exciting place to study, providing students with outstanding learning, sports and social facilities. Our students come from all over the UK and all over the world, attracted by the excellence of our academic provision in one of Britain\'s liveliest and most multicultural cities, buzzing with events, cinemas, exhibitions, clubs and bars that cater for every taste and background.'),(52,'M80','Middlesex University','http://www.mdx.ac.uk','Middlesex is a modern university based in North London. We are renowned for our forward looking approach to higher education and innovative teaching. Middlesex is also one of the most multinational universities in the country, with a quarter of our students coming from outside the UK and 130 different countries represented. We have a reputation for the highest quality teaching, research that makes a real difference to people\'s lives and a practical, innovative approach to working with businesses to enhance programmes. Our academic credentials are outstanding and all of our courses are developed and structured with the goal of enabling students to develop professionally in the UK or overseas. We are in the top 10 of all universities in the UK for salaries on graduation.  We have been consistently recognised by the Quality Assurance Agency for the highest standards in teaching and the most recent UK Research Assessment Exercise (RAE) found 77% of our research to be \'internationally recognised\'. Students are at the heart of everything we do. Our state-of-the-art facilities are among the best anywhere, with more than ï¿½200 million invested in creating one of London\'s biggest and best campuses - part of our commitment to providing an excellent student experience.'),(53,'N21','Newcastle University','http://www.ncl.ac.uk/international/','Newcastle University is one of the UK\'s leading universities with an international reputation for excellence. Our campus is located in the heart of Newcastle, a culturally rich and vibrant city in the north of England. We have a tradition of welcoming international students, and currently have more than 4000 international students from more than 100 different countries. We offer a wide range of degree programmes including highly regarded programmes in Medical Sciences, Science and Engineering. The quality of our work has been recognised through prestigious awards and our commitment to \'education for life\' is backed up by our strong graduate employability record.'),(54,'N37','University of Wales - Newport','http://www.newport.ac.uk/international/Pages/InternationalHome.aspx','University of Wales Newport has a long and distinguished history in Art and Design education.  It has an international reputation in photography, film and broadcast, and is currently establishing a growing profile within design, particularly within both Fashion and Advertising Design. Many of the Courses are located with the universities new award winning city centre campus that includes the Faculty of Arts and Business. This allows all students to develop a range of specialist skills, and apply their creativity to the world of business and industry. Courses are linked to a number of industry organisations such as the British Fashion Council, D&AD, and Skillset, all of which support student with gaining employment within the Creative Industries following graduation.'),(55,'N38','University of Northampton','http://www.northampton.ac.uk/','For more information on the University of Northampton visit their website.'),(56,'N77','Northumbria University','http://www.northumbria.ac.uk/brochure/international','Northumbria University is one of the UK\'s largest and most successful universities. Offering over 450 undergraduate and postgraduate degrees in most major subjects includingBusiness, Law, Computing, Engineering, Art, Design, Science, Health, Sport and many more. Our lecturers are experts in their field and passionate about teaching. Northumbria is both research-engaged and business focussed, enjoying excellent links to industry and the professions.  Many of our courses carry professional accreditation. We are located in Newcastle upon Tyne, voted the UK\'s Best University City*, where the cost of living is lower than many other UK cities. *MSN Travel.'),(57,'N84','The University of Nottingham','http://www.nottingham.ac.uk/global/home.aspx','The University of Nottingham is a founder member of the Russell Group, the UK equivalent to the US Ivy League, which represents 20 leading UK universities committed to maintaining world class research, an outstanding teaching and learning experience and unrivalled links with business and the public sector. Overall, Nottingham is ranked in the UK\'s Top 10 and the World\'s Top 75 universities by the Shanghai Jiao Tong (SJTU) and the QS World University Rankings.  In 27 subject areas, the University features in the UK Top Ten, with 14 in the Top Five. Our innovative and top quality teaching is informed by the latest research and delivered by hundreds of specialist, cross-faculty research groups.   We have been awarded two Nobel Prizes in Medicine and Economics.  On a measurement of \'research power\', which takes into account both quality of research and the number of research-active staff, Nottingham is 7th in the UK according to independent analysis by Research Fortnight.'),(58,'N91','Nottingham Trent University','http://www.ntu.ac.uk/international/index.html','For more information on Nottingham Trent University please visit their website.'),(59,'P80','University of Portsmouth','http://www.port.ac.uk/departments/studentsupport/international/','A lively, friendly and safe city on the South Coast of England. City campus, 90 minutes from London. Regular ferries to France and Spain. Extensive range of degree programmes. Popular subjects include Architecture, Engineering, Computing & Information Technology , Design and Creative Industries, Computer Games, Film, TV & Radio, Performing Arts, Pharmacy & Biomedical Sciences and Physical Sciences. State-of-the-Art facilities, vocational based syllabus. Welcoming and Supportive - airport pick-up, induction programme, dedicated International Student Advisers.'),(60,'Q50','Queen Mary - University of London','http://www.qmul.ac.uk/international/countries/brazil/70885.html','Queen Mary is one of the UK\'s leading research-focused higher education institutions and a member of the prestigious Russell Group of universities.  With around 17,000 students and 3,000 staff it is one of the largest colleges of the University of London.  QM offers a wide range of subjects in humanities, social sciences, law, medicine and dentistry, and science and engineering. Based in a creative and culturally diverse area of east London, it is unusual in offering a completely integrated residential campus environment.  QM offers a high quality research and learning environment that attracts a diverse and highly motivated student body from all over the world.'),(61,'Q75','Queen\'s University Belfast','http://www.qub.ac.uk/directorates/StudentPlus/MarketingRecruitmentandAdmissions/InternationalOffice/','For more information about Queens University Belfast please visit their website.'),(62,'R12','The University of Reading','http://www.reading.ac.uk/science-without-borders-scholarships','The University of Reading is a top-ranked university located in the south of the UK. Our focus on research excellence has led us to be listed among the top 200 universities in the world. We have academics who are global leaders in their areas and independent guides have ranked many of our departments as the top in the UK, including Agriculture (1st) and Art & Design (4th). We receive consistently high marks for student satisfaction and many students say that the supportive atmosphere, as well as the beautiful campus, gives the University a feeling of home.'),(63,'R48','Roehampton University','http://www.roehampton.ac.uk/International/','Roehampton, London\'s only campus university, has a strong research profile, ranking number one in the UK for our research in Biological Anthropology and Dance. We place a strong emphasis on contact with academics who are internationally known for their work. Roehampton has approximately 9000 students from over 130 nationalities.  Roehampton excels in programmes related to the Creative Arts and Humanities, Business, Psychology and Life Sciences. We offer a distinctive collegiate experience with 1,500 residential places on campus, approximately 6 miles from London\'s West End. This campus community facilitates integration into your new home, enhances the time you spend with us and creates an environment in which you can maximise your studies.'),(64,'R72','Royal Holloway - University of London','http://www.rhul.ac.uk/international/home.aspx','For more information on Royal Holloway - University of London please visit their website.'),(65,'R84','The Royal Veterinary College','http://www.rvc.ac.uk','Founded in 1791, the RVC has a unique heritage of innovation in veterinary and biomedical sciences, clinical practice and education and is one of the leading specialist institutions in its field, bringing together many talented individuals, all of whom share a passion for human and animal health and welfare. Our broad range of programmes are of international appeal and attract students who go on to become practising veterinarians, human and animal scientists, veterinary nurses and leaders in industry and government. RVC owns the London BioScience Innovation Centre, London\'s first and largest centre for early stage life science companies, venture investors and others in this sector. This puts the RVC at the heart of biotechnology and other biomedical research in London and opens the door for research collaboration. For the Science without Borders programme the RVC can offer a bespoke year on our BSc Bioveterinary Sciences degree which will include both compulsory and elective modules, a literature review and a three month lab-based research project. Our research-intensive Biomedical Sciences curriculum is taught with up-to-date literature and use of cutting-edge techniques, and offers a wide range of topics, from Biomechanics and Skeletal Pathobiology to Parasitology of Tropical Diseases and Wild Animal Biology. There\'s even an opportunity to learn to become a skilled molecular biologist in less than three weeks! RVC is based in both central London and Hertfordshire (which is a 20 minute train journey from London Kings Cross).'),(66,'S03','The University of Salford','http://www.salford.ac.uk/study/international/lang/en','Based 1.5 miles from the centre of the multicultural world class city of Manchester in the Northwest of England, the Salford Royal Technical Institute was established in 1896 and became the University of Salford with full degree awarding powers in 1967. The University has over 20,000 students including 3,500 international students from over 130 different countries around the world.  Our academic enterprise is based around a set of four priority themes: Built and Human Environment, Energy, Health and Wellbeing and Media, Digital Technology and the Creative Economy. The University of Salford is rapidly expanding in the areas referred to in the STEM fields, and in addition the University has established strong links in healthcare professions, the digital media industry and has made major investment into MediaCityUK, the new base for the BBC and ITV broadcasting corporations.'),(67,'S18','The University of Sheffield','http://www.shef.ac.uk/international','The University of Sheffield is ranked among the top 100 Universities in the world. A member of the Russell Group, it has a reputation for world-class teaching and research across a wide range of disciplines, including Engineering, Science, Social Sciences and Medicine.  The University is the current UK University of the Year and has won four Queen\'s Anniversary Prizes, in recognition of its outstanding contributions to the United Kingdom\'s intellectual, economic, cultural and social life. Sheffield also boasts five Nobel Prize winners. There are currently 25,000 students at the University from over 128 countries.'),(68,'S21','Sheffield Hallam University','http://www.shu.ac.uk/international/','Sheffield Hallam is one of the UK\'s largest universities, with almost 36,000 students and more than 3,200 staff. Our learning and teaching facilities are some of the most advanced in the UK and we have invested over ï¿½100m in them over the last decade. The latest Research Assessment Exercise placed us in the top ten of modern universities in England. We were awarded ï¿½5.1 million in quality-related funding for research in 2009-10. Almost 70 per cent of our research was judged to be of an international standard. We work closely with national and international companies to ensure you\'re gaining the expertise required by industry. Over 70 professional bodies accredit our courses, ensuring they meet industry recognised quality standards.'),(69,'S27','University of Southampton','http://www.southampton.ac.uk/international/countrypages/sciencewithoutborder.shtml','Situated in a warm and green city, and close to Europe\'s second largest maritime port on the south coast of England, the University of Southampton offers students a cosmopolitan and culturally diverse environment in which to study and live.  Southampton is a UK top 10 research-led University and is ranked 75th on QS World Rankings 2011 for its strengths in Engineering, Electronics, Art, Law and Management. It is internationally renowned for its pioneering research, first class facilities and teaching.'),(70,'S36','University of St Andrews','http://www.st-andrews.ac.uk/scholarships/brazil/','The University of St Andrews is the third oldest university in the English-speaking world and celebrates its 600th anniversary next year. It is relatively small (c. 8000 students) but has a cosmopolitan atmosphere - one third of its students are from overseas. It has an international reputation for delivering high quality teaching and research, and is consistently ranked amongst the top 100 universities in the world, and amongst the top five universities in the UK.  It has research strengths across the entire spectrum of science disciplines ranging from nanotechnology and bio-molecular medicine to astrophysics and the study of large sea mammals.'),(71,'S75','The University of Stirling','http://www.stir.ac.uk/study-in-the-uk/','Stirling has a strong tradition of welcoming International Students. With over 100 nationalities represented on campus, International Students form a vital part of the community and are testament to the University\'s inclusive and dynamic spirit. The campus is regarded as one of Europe\'s most beautiful- providing a safe, peaceful environment. Stirling\'s state-of-the-art facilities complement its status as one of the UK\'s leading research universities across a range of disciplines.  Its School of Natural Sciences conducts research which is internationally recognised for its quality and relevance.'),(72,'S78','The University of Strathclyde','http://www.strath.ac.uk/rio/prospective/','For more than 200 years, the University of Strathclyde has been meeting the needs of students, employers, industry and wider society through research, teaching, business and enterprise. Situated in the heart of Glasgow - Scotland\'s largest city - the University has a vibrant, international community and is home to more than 16,000 full-time students from more than 100 countries. Each of the University\'s four faculties - Strathclyde Business School, Engineering, Science and Humanities & Social Sciences- works closely with business, industry, government and policy makers, supporting the University\'s enviable track record of making technologies and innovation applicable for the benefit of society.'),(73,'S84','University of Sunderland','http://www.sunderland.ac.uk/international/','Located in the North East of England, the University of Sunderland has over 17,000 students on campus; over 2,500 from overseas. We are an innovative, forward-thinking university with high standards of teaching, research and support in the heart of one of the UK\'s most up and coming cities. We offer a wide range of quality undergraduate and postgraduate programmes across four faculties:  Art, Design and Media;  Applied Sciences;  Business and Law;  Education and Society.  We are recognised for our excellent programmes in Pharmacy, Law, Business and Media.  Our first class facilities attract students from across the World; facilities including the new ï¿½8.5m Sciences Complex; the first entirely digital media department in the UK and state of the art sports and IT facilities.'),(74,'S85','University of Surrey','https://www.surrey.ac.uk/international/','Situated in the town of Guildford, the University of Surrey is less than 40 minutes by train from central London.  The University has a reputation for excellence in teaching and research in Biology, Chemistry, Physics, Engineering, Mathematics and the Creative Industries.  The University also has an unrivalled track record in preparing students for their future careers and is ranked first amongst English universities for graduate employability. Our attractive, friendly and safe campus welcomes students from 145 nations. We have close links with leading Brazilian universities and look forward to welcoming undergraduate and postgraduate students through the Science without Borders programme.'),(75,'S90','University of Sussex','http://www.sussex.ac.uk/international/','For more information on the University of Sussex please visit their website.'),(76,'S93','Swansea University','http://www.swansea.ac.uk/international/','Swansea University is a research-led university that has been making a difference since 1920. The University community thrives on exploration and discovery, and offers the right balance of excellent teaching and research, matched by an enviable quality of life. With 15,921 students and 2,510 staff, Swansea\'s campus lifestyle fosters a welcoming, cosmopolitan community that offers something for everyone. London is only three hours away with direct trains running hourly. Swansea is a very safe, friendly, inexpensive and cosmopolitan city offering a wide range of social, cultural and sporting facilities, including a spectacular waterfront marina, museum complex and sports stadium.  The City\'s soccer team - the Swans - were promoted to the English Premier League this season 2011/12 and have outperformed many of the English teams to remain in the division for next season - a huge achievement and the first Welsh team ever to do so!'),(77,'T20','Teesside University','http://www.tees.ac.uk/international/','Teeside University is consistently ranked in the top four in the UK for student satisfaction (International Student Barometer 2008-11). Students benefit from lecturers who are current creative practitioners and researchers. Courses include graphic design, computer animation, games, product and interior design. Our new Phoenix and Athena Buildings offer high-tech studio space to digital media and design students plus DigitalCity enterprise studios.  DigitalCity companies are graduate enterprises that trade internationally with recognised brands. Interior and spacial architecture graduates start consultancies or work for international architecture firms. Product designers can go on to head industrial design departments for multinational design led retail product companies.'),(78,'U20','University of Ulster','http://international.ulster.ac.uk/','The University of Ulster is looking forward to welcoming students from Brazil as part of the Science without Borders programme. Our key aim is to provide you with a learning experience that will give you the confidence, knowledge and skills to take up challenging employment opportunities.  Choosing Ulster means that you will study at a university with an excellent reputation for teaching and learning and for world-class focused research which sets us apart from other education providers. Northern Ireland is one of the most fashionable destinations in the UK.  National Geographic magazine recently voted Belfast in the world\'s top 10 destinations.'),(79,'U65','University of the Arts London','http://www.arts.ac.uk/international/','University of the Arts London is a vibrant international centre for innovative teaching and research in art, design, fashion, communication and performing arts. The University\'s creative community is made up of six distinguished Colleges: Camberwell College of Arts, Central Saint Martins College of Arts and Design, Chelsea College of Art and Design, London College of Communication, London College of Fashion and Wimbledon College of Art. Renowned names in the creative sectors produced by the University include 12 Turner prize winners and over half of all nominees, 10 out of 17 fashion designers named British Designer of the Year, more than half of the designers showcased in London Fashion Week and 12 out of 30 winners of the Jerwood Photography Award.'),(80,'U80','University College London - University of London','http://www.ucl.ac.uk/prospective-students/international-students','University of the Arts London is a vibrant international centre for innovative teaching and research in art, design, fashion, communication and performing arts. The University\'s creative community is made up of six distinguished Colleges: Camberwell College of Arts, Central Saint Martins College of Arts and Design, Chelsea College of Art and Design, London College of Communication, London College of Fashion and Wimbledon College of Art. Renowned names in the creative sectors produced by the University include 12 Turner prize winners and over half of all nominees, 10 out of 17 fashion designers named British Designer of the Year, more than half of the designers showcased in London Fashion Week and 12 out of 30 winners of the Jerwood Photography Award.'),(81,'UK1','Royal College of Music','http://www.rcm.ac.uk/','The Royal College of Music is one of the world\'s leading conservatoires, providing professional training for outstanding young musicians and composers from all four corners of the globe.  Our students have the chance to work with  inspiring teachers, enjoy an outstanding range of performance opportunities, develop professional contacts, be at the centre of cutting-edge research (including access to our world-renowned library and historical collections), and be part of a friendly, supportive and stimulating environment - all whilst benefitting from the wealth of cultural activity to be found in London.'),(82,'UK3','Guildhall School of Music and Drama','http://www.gsmd.ac.uk/about_the_school/shared_left_nav/life_at_the_school/international_students/','The Guildhall School of Music & Drama is one of the world\'s leading conservatoires and drama schools, offering musicians, actors, stage managers and theatre technicians an inspiring environment in which to develop as artists and professionals. The School is a global leader of creative and professional practice and promotes innovation, experiment and research. With over 800 students in higher education, drawn from nearly 60 countries around the world, the School is also the UK\'s leading provider of specialist music training at the under-18 level with nearly 2,500 students in Junior Guildhall and the Centre for Young Musicians.'),(83,'W01','University of South Wales','http://www.southwales.ac.uk/international/','The University of South Wales  was formed recently through a merger of the University of Glamorgan and the University of Wales, Newport to become one of the largest universities in the UK and the largest in Wales with 33,000 students. The University has campuses throughout South Wales, in Cardiff, Newport and Pontypridd. Our unique locations mean you can enjoy everything the region has to offer - city life and culture, stunning beaches and breathtaking countryside. Employability  is at the heart of everything we do, with teaching informed by what happens in the real world. Our graduates have the skills that are essential for the workplace and value our employability schemes, business start-up support and opportunities to get actual experience, often as part of your course.  It\'s an approach that works - 93% of our graduates are in employment or further study within six months of graduation. We think it\'s essential to keep up with the ever-changing working environment, so we have very close links with relevant employers and industries. Companies like British Airways, General Electric, Sony, Tata and the BBC tell us what\'s going on, so we can design courses that give you the skills they\'re looking for.'),(84,'W05','The University of West London','http://www.uwl.ac.uk/international.jsp','For more information on the University of West London please visit their website.'),(85,'W20','The University of Warwick','http://www2.warwick.ac.uk/services/international/','The University of Warwick is one of the UK\'s leading universities with an acknowledged reputation for excellence in research and teaching, for innovation, and for links with business and industry. Warwick has over 22,000 students studying within the Faculties of Arts, Science, Social Science and Medicine. The University is ranked comfortably in the top 10 of all UK university league tables. It is an international university attracting some of the very best students from all over the world. The University is the second most targeted by graduate employers for graduate recruitment programmes in the UK. Warwick ranked seventh overall in the UK Research Assessment Exercise. Warwick has invested significantly in its student facilities, refurbishing and modernising its library and creating new study environments.'),(86,'W50','University of Westminster','http://www.westminster.ac.uk','We lead the world in research in architecture, art, media and communications, while our research work in areas such as business, computing, law, life sciences and the environment and planning has been recognised as internationally excellent. Many of our courses have also received excellent quality ratings. We are based in the heart of Central London and offer a distinctly British learning experience within a truly international environment, with one of the largest and most diverse overseas student bodies of any university in the world, drawn from over 150 countries. So come and join the Westminster family as we celebrate 175 years of world-leading research, pioneering teaching, and providing education for all, regardless of background or financial status.'),(87,'W75','University of Wolverhampton','http://www.wlv.ac.uk/io','Our vision is to be The Opportunity University renowned for its creativity and innovation, developing students and staff who are entrepreneurial, eminently employable and well-connected within a research and professionally informed environment.  Our portfolio ranges from biosciences to social sciences, construction to engineering, law to computing and management, education to health and wellbeing, and creative and performing arts. We attract students from Asia, Europe, Africa and we have c3000 overseas students studying in the UK. Our research performance is excellent across the areas of Design, IT, language of computing, the Built Environment and Brain Tumours. We have invested c. ï¿½125m in the last ten years, our world class learning facilities, broad portfolio and a diverse student population are key factors in the reasons for students choosing us.'),(88,'Y50','The University of York','http://www.york.ac.uk/','The University of York welcomes Brazilian students applying through Science without Borders. York is a high-quality, research-focused university offering a diverse student lifestyle. You can expect a welcoming environment and strong support networks alongside excellent academic and social facilities, all close to the beautiful, historic city of York. International students make up around 22 percent:w\n of the student population across all subjects.');
